import React from "react";
import ReactDOM from "react-dom";
import Cards from "./Cards";
import Sdata from "./SData";
import './index.css';

ReactDOM.render(
    <>
    <h1>Most viewewd seasons in 2022</h1>
    <div className="container">   
    <div className="row">
     {Sdata.map((val, index)=>{
         {console.log(index);}
         
    return(    <Cards
        key = {val.id}
        imgsrc={val.imgsrc}
        title={val.title}
        SName={val.SName}
        refrence={val.refrence}
        />);

     })} 
     </div>
     </div>

        {console.log(Sdata)}
    </>
    ,
    document.getElementById("root"));
